import React, { useState } from 'react';
import LogedinState from './LogedinState';
import LogedoutState from './LogoutState';

const Login = (props) => {
    const [isLogedIn, setIsLogedIn] = useState(false)
    return(
        <>
            <h2>Login Form</h2>
            {isLogedIn ? <LogedinState /> : <LogedoutState /> }
        </>
    )
}

export default Login
